import { Map, TileLayer, LayersControl,
  LayerGroup, } from "react-leaflet";
export default function MapComp({peersByStoragePower}) {
  return (
    <Map center={[51.505, -0.09]} zoom={2}>
      <TileLayer
        attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
      <LayersControl position="topright">
          {Object.keys(nodesByClientTypes).map((clientType) => (
            <LayersControl.Overlay key={clientType} checked name={clientType}>
              <LayerGroup>
                {nodesByClientTypes[clientType].map((node) => (
                  <Marker
                    key={node._id}
                    position={[node.location.Lat, node.location.Lon]}
                    icon={iconStyle}
                  >
                    <Tooltip>{`Using ${node.client.type} v.${node.client.version} From ${node.city}`}</Tooltip>
                  </Marker>
                ))}
              </LayerGroup>
            </LayersControl.Overlay>
          ))}
        </LayersControl>
    </Map>
  );
}
